import React from 'react'
import { useState, useEffect } from 'react';
import axios from 'axios';

export default function NotificationsMiddle() {
    const [notifications, setNotifications] = useState([]);

    useEffect(() => {
        console.log("Running");
        const link = "http://localhost:8080/api/notifications/find/" + sessionStorage.getItem("user_id");
        console.log("Link: ", link)
        axios.get(link)
            .then(response => setNotifications(response.data))
            .catch(err => console.log(err));
    }, [])


    return (
        <>
            <h1 className="text-start ps-2">Notifications</h1>
            <h3>
                {
                    notifications.length == 0 ?
                        "You currently have no notifications"
                    :notifications.length == 1 ?
                        "You have 1 notification"
                    :
                        "You have " + notifications.length +" notifications"
                }
            </h3>
            <hr />
            <ul>
                {
                    notifications.map((item, index) => {
                        return item.senderName+ " sent you a friend request!";
                    })
                }
            </ul>
        </>
    )
}
